// HotPlaceDetail.js

import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

import "../Home.css"
function HotPlaceDetail() {
    const { placeName } = useParams();
    const [placeData, setPlaceData] = useState(null);
    const SEOUL_OPEN_DATA_AUTH_KEY_ = "515653596b79756a38384a77506645";
    const navigate = useNavigate();
    useEffect(() => {
        // 페이지가 로드될 때 API 호출하여 해당 장소에 대한 데이터를 받아옴
        async function fetchPlaceData() {
            try {
                const response = await fetch(`http://openapi.seoul.go.kr:8088/${SEOUL_OPEN_DATA_AUTH_KEY_}/json/citydata/1/5/${placeName}`);
                const data = await response.json();
                console.log(data);
                // API 응답 데이터를 상태로 설정
                setPlaceData(data);
            } catch (error) {
                console.error('Error fetching place data:', error);
            }
        }
        fetchPlaceData();
    }, [placeName]);
    // 홈 화면으로 돌아가는 함수
    const goBackToHome = () => {
        navigate('/');

    };
    return (
        <div className="app_container">
        <header className="header">
          <div className="app-header-left-content">
            <h1>서울을 찾아서</h1>
            <h4>숨겨진 서울의 모습 찾아서, AI 기반 관광 추천 서비스</h4>
             {/* 받아온 데이터를 표시 */}
             <button onClick={goBackToHome}>홈 화면으로 돌아가기</button>
          </div>
          <div className="app-header-right-content">
           <LanSelection/>
          </div>
        </header>

        <div className="body-content">
          <div className="block">
                <LocationSearchField setWeatherData={setWeatherData}/>
          </div>
          <div className="item-container">
            <div className="double-item">
              <div className="block_weather">
                <h2>오늘의 관광날씨는?</h2>
                {weatherData && (
                  <WeatherComponent
                    temperature={weatherData.temperature}
                    precipitation={weatherData.precipitation}
                    humidity={weatherData.humidity}
                    windSpeed={weatherData.windSpeed}
                    mes_air={weatherData.mes_air}
                    mes_uv={weatherData.mes_uv}
                    mes_rain={weatherData.mes_rain}
                  />
                )}

                <h5>관광 시 추천하는 준비물</h5>
                <div className="weather_container">
                  <div className="icon_container">
                    <div className="weather_icon">
                      <img src="/png/mask.png" alt="mask" /> 
                    </div>
                    <div className="icon_title"> 마스크</div>

                  </div>
                  <div className="icon_container">
                    <div className="weather_icon">
                      <img src="/png/umbrella.png" alt="umbrella" /> 
                    </div>
                    <div className="icon_title"> 우산</div>

                  </div>
                </div>

              </div>
              <div className="block_top">
              <h2>서울의 핫플 Top5</h2>
              <HotPlaces/>
              </div>    
            </div>


            <div className="block2">
              <h2>주변 관광지 찾아보기</h2>
              필터 (복수 선택 가능)
              <ReFilterButtons selectedFilters={selectedFilters} setSelectedFilters={setSelectedFilters} />
              <Map selectedFilters={selectedFilters} />
            </div>
          </div>

          <div className="block">
          <h2>관광 코스 추천 받기</h2>
          장소의 갯수를 선택해주세요
          <NumFilterButtons/>
          원하는 분류를 선택해주세요 (복수선택 가능)
          <FilterButtons/>
          <div style={{ textAlign: "center" }}>
            <button className="recommand_button"> 추천 받기</button>
          </div>
          </div>
        </div>

        <footer className="footer">
          대표 이메일 : dudumchit2023@gmail.com <br></br>
          Copyright © 서로감자
        </footer>

        </div>


      );

}

export default HotPlaceDetail;
